export const getProductByBarcode = async (barcode) => {
    const result = await fetch("db/products.json")
    .then(response => {
        const data = response.json();

        const product = data.find((product)=> product.barcode === barcode);
        console.log(product);
        return product;
    })
    .catch(err => {
        console.error(Error(err))
        return null;
    });
    console.log("object");
    return result;
}
